import React from "react";
import "./project.css";
// import Projectone from "../../Images/profile.JPG"

const Projects = () => {

    return (
        <div className="main-content-area-box">
            <h2 className="headline">Projects</h2>
            <div class="featured__StyledProject-sc-19vdtah-9 VhaEB"
                data-sr-id="4"><div class="featured__StyledContent-sc-19vdtah-1 gWlhZI"><h4 class="featured__StyledLabel-sc-19vdtah-2 dZTpBf">Featured Project</h4><h5 class="featured__StyledProjectName-sc-19vdtah-3 jRnWTV"><a href="https://www.youtube.com/watch?v=AAkNyZlUae0" target="_blank" rel="nofollow noopener noreferrer" aria-label="External Link">Face Mask Detection</a></h5><div class="featured__StyledDescription-sc-19vdtah-4 hwxmov">
                    <p>Face Mask Detection system to detect face masks in static
                         images as well as in real-time video streams. Own 
                         custom dataset was built using Bing Search API and
                          Kaggle.</p>
                    <p>Inspired by Adrian Rosebrock's <a href="www.gothub.com" target="_blank" rel="nofollow noopener noreferrer">PyImageSearch Blog</a>.</p>
                    </div><ul class="featured__StyledTechList-sc-19vdtah-5 gikkDn"><li>OpenCV</li><li>TensorFlow</li><li>Keras</li><li>Python</li></ul><div class="featured__StyledLinkWrapper-sc-19vdtah-6 gDgIRh"><a href="https://github.com/chandrikadeb7/Face-Mask-Detection" target="_blank" rel="nofollow noopener noreferrer" aria-label="GitHub Link"><title>GitHub</title><svg xmlns="http://www.w3.org/2000/svg" role="img" viewBox="0 0 438.549 438.549"></svg></a>
                    </div>
                </div>
            </div>
        </div>
    );
}

export default Projects;
